%% 0: load files

clear all;

expFileName = '18X12-revcor4-2P-3X-Erik-AxonG-8442-28Sep2021-clean';

fn = expFileName;
disp(['Loading ' fn]);
load(fn);

fn = [expFileName '-ROI'];
disp(['Loading ' fn]);
load(fn);

fn = [expFileName '-Stim'];
disp(['Loading ' fn]);
load(fn);

disp('Files loaded.');
%% 1: variables
% time variables
stimFrameIntervalSec = mean(diff(e(1).flipTimes));
tBeforeSec = -4;
tAfterSec = 4;
tBeforeSubtractMean = -2;

iBefore = round(tBeforeSec / stimFrameIntervalSec);
iAfter = round(tAfterSec / stimFrameIntervalSec);
x = (iBefore : iAfter) * stimFrameIntervalSec;
iBeforeSubtractMean = (-iBefore + round(tBeforeSubtractMean / stimFrameIntervalSec)) : -iBefore;
iBefore = cast(iBefore, 'int16');
iAfter = cast(iAfter, 'int16');
%% 2: find, cut out, average responses per patch

% Go by roi, find max response over all patches
% stores max resp regardless of value; can then apply cutoff later
% stores by motion direction; adds every response to every corresp. list

% for batches
% for the record, I can stop whenever
% can also use 'toc' after program has terminated
start=3167;
stop=length(eROI.roi);
% store max response of each ROI; indexed by ROI
maxes0 = zeros(stop-start+1,1);
maxes90 = zeros(stop-start+1,1);
maxes180 = zeros(stop-start+1,1);
maxes270 = zeros(stop-start+1,1);
% repeat for global motion
gMaxes0 = zeros(stop-start+1,1);
gMaxes90 = zeros(stop-start+1,1);
gMaxes180 = zeros(stop-start+1,1);
gMaxes270 = zeros(stop-start+1,1);
tic
for roi = start:stop
    disp(['Processing ROI ',num2str(roi),'...']);
    for patch = 1:eStim.patchMotion.numPatches
        F = eROI.roi(roi).Fraw.F;
        % zscore
        F = slidingWindowZScore(e,F,1);
        % resample to frames
        F = resampleToFlipTime(F, e);
        % store responses per trial, by direction
        % patch
        resp0 = [];
        resp90 = [];
        resp180 = [];
        resp270 = [];
        % global
        if patch == 1
            gResp0 = [];
            gResp90 = [];
            gResp180 = [];
            gResp270 = [];
        end
        % loop thru trials
        for trial=1: length(e)
            % check for sparse noise
            motion = strcmp(eStim.trial(trial).type, 'Motion');
            if motion
                % patch motion
                pulseTimes = double(eStim.trial(trial).patchMotion(patch).startFrame);
                temp0 = [];
                temp90 = [];
                temp180 = [];
                temp270 = [];
                % global
                gTemp0 = [];
                gTemp90 = [];
                gTemp180 = [];
                gTemp270 = [];
                % handle patch motion first
                % loop thru each on/off for patch and cut
                for i=1 : length(pulseTimes)
                    % convert; starting point w.r.t. stim fliptimes
                    startIndex = F(trial).firstStimIndex+pulseTimes(i)-1;
                    % cut out F
                    tempF = cutOut2(F(trial).F, startIndex, iBefore, iAfter);
                    % store by direction
                    if eStim.trial(trial).patchMotion(patch).directionDeg(i) == 0
                        temp0 = [temp0 ; tempF];
                    elseif eStim.trial(trial).patchMotion(patch).directionDeg(i) == 90
                        temp90 = [temp90 ; tempF];
                    elseif eStim.trial(trial).patchMotion(patch).directionDeg(i) == 180
                        temp180 = [temp180 ; tempF];
                    else % 270º
                        temp270 = [temp270 ; tempF];
                    end
                end
                % now handle global motion
                if patch == 1 % only check once per trial
                    % convert; starting point w.r.t. stim fliptimes
                    startIndex = F(trial).firstStimIndex+eStim.trial(trial).globalMotion.startFrame-1;
                    % cut out F
                    tempF = cutOut2(F(trial).F, startIndex, iBefore, iAfter);
                    % store by direction
                    if eStim.trial(trial).globalMotion.directionDeg == 0
                        gTemp0 = [gTemp0 ; tempF];
                    elseif eStim.trial(trial).globalMotion.directionDeg == 90
                        gTemp90 = [gTemp90 ; tempF];
                    elseif eStim.trial(trial).globalMotion.directionDeg == 180
                        gTemp180 = [gTemp180 ; tempF];
                    else % 270º
                        gTemp270 = [gTemp270 ; tempF];
                    end
                end
                
                % now we have all responses for 1 trial for our patch
                % average them by direction and save to be averaged over trials
                temp0 = mean(temp0, 1,'omitnan');
                temp90 = mean(temp90, 1, 'omitnan');
                temp180 = mean(temp180, 1, 'omitnan');
                temp270 = mean(temp270, 1, 'omitnan');
                
                if patch == 1
                    gTemp0 = mean(gTemp0, 1,'omitnan');
                    gTemp90 = mean(gTemp90, 1, 'omitnan');
                    gTemp180 = mean(gTemp180, 1, 'omitnan');
                    gTemp270 = mean(gTemp270, 1, 'omitnan');
                end
                % patch
                if ~isempty(temp0)
                    resp0 = [resp0;temp0];
                end
                if ~isempty(temp90)
                    resp90 = [resp90;temp90];
                end
                if ~isempty(temp180)
                    resp180 = [resp180;temp180];
                end
                if ~isempty(temp270)
                    resp270 = [resp270;temp270];
                end
                % global
                if patch == 1
                    if ~isempty(gTemp0)
                        gResp0 = [gResp0;gTemp0];
                    end
                    if ~isempty(gTemp90)
                        gResp90 = [gResp90;gTemp90];
                    end
                    if ~isempty(gTemp180)
                        gResp180 = [gResp180;gTemp180];
                    end
                    if ~isempty(gTemp270)
                        gResp270 = [gResp270;gTemp270];
                    end
                end
            end
        end
        % now we have all trials for our patch
        % average them by color and save as final patch response
        % patch
        resp0 = mean(resp0, 'omitnan');
        resp90 = mean(resp90, 'omitnan');
        resp180 = mean(resp180, 'omitnan');
        resp270 = mean(resp270, 'omitnan');
        
        % global
        if patch == 1
            gResp0 = mean(gResp0, 'omitnan');
            gResp90 = mean(gResp90, 'omitnan');
            gResp180 = mean(gResp180, 'omitnan');
            gResp270 = mean(gResp270, 'omitnan');
        end
        
        % bring to baseline
        % patch
        signal = resp0;
        baseline = mean(signal(iBeforeSubtractMean));
        resp0 = signal - baseline;
        
        signal = resp90;
        baseline = mean(signal(iBeforeSubtractMean));
        resp90 = signal - baseline;
        
        signal = resp180;
        baseline = mean(signal(iBeforeSubtractMean));
        resp180 = signal - baseline;
        
        signal = resp270;
        baseline = mean(signal(iBeforeSubtractMean));
        resp270 = signal - baseline;
        
        % global
        if patch == 1
            signal = gResp0;
            baseline = mean(signal(iBeforeSubtractMean));
            gResp0 = signal - baseline;
            
            signal = gResp90;
            baseline = mean(signal(iBeforeSubtractMean));
            gResp90 = signal - baseline;
            
            signal = gResp180;
            baseline = mean(signal(iBeforeSubtractMean));
            gResp180 = signal - baseline;
            
            signal = gResp270;
            baseline = mean(signal(iBeforeSubtractMean));
            gResp270 = signal - baseline;
        end
        
        % determine if this patch response is max
        if patch == 1
            maxResp0 = resp0;
        elseif max(resp0)>max(maxResp0)
            maxResp0 = resp0;
        end
        if patch == 1
            maxResp90 = resp90;
        elseif max(resp90)>max(maxResp90)
            maxResp90 = resp90;
        end
        if patch == 1
            maxResp180 = resp180;
        elseif max(resp180)>max(maxResp180)
            maxResp180 = resp180;
        end
        if patch == 1
            maxResp270 = resp270;
        elseif max(resp270)>max(maxResp270)
            maxResp270 = resp270;
        end
    end
    % take peak of avg. curve
    max0 = max(maxResp0);
    max90 = max(maxResp90);
    max180 = max(maxResp180);
    max270 = max(maxResp270);
    % global
    gMax0 = max(gResp0);
    gMax90 = max(gResp90);
    gMax180 = max(gResp180);
    gMax270 = max(gResp270);
    
    % add final max response to lists
    % patch
    maxes0(roi) = max0;
    maxes90(roi) = max90;
    maxes180(roi) = max180;
    maxes270(roi) = max270;
    % global
    gMaxes0(roi) = gMax0;
    gMaxes90(roi) = gMax90;
    gMaxes180(roi) = gMax180;
    gMaxes270(roi) = gMax270;
    
    % print
    disp(['ROI ',num2str(roi),' maxes = ',num2str(max0),' ',num2str(max90),' ',...
        num2str(max180),' ',num2str(max270),' ',num2str(gMax0),' ',num2str(gMax90),...
        ' ',num2str(gMax180),' ',num2str(gMax270)]);
    
end

% report responsive ROIs
disp(['ROIs ',num2str(start),' to ',num2str(roi)]);
toc;
disp('Patch motion:');
disp(['0º : ',num2str(transpose(maxes0(start:roi)))]);
disp(['90º : ',num2str(transpose(maxes90(start:roi)))]);
disp(['180º : ',num2str(transpose(maxes180(start:roi)))]);
disp(['270º : ',num2str(transpose(maxes270(start:roi)))]);
disp('Global motion:');
disp(['0º : ',num2str(transpose(gMaxes0(start:roi)))]);
disp(['90º : ',num2str(transpose(gMaxes90(start:roi)))]);
disp(['180º : ',num2str(transpose(gMaxes180(start:roi)))]);
disp(['270º : ',num2str(transpose(gMaxes270(start:roi)))]);
